# Designed for storing and reading experiment data
import pandas as pd

class Experiment():
  def __init__(self,flags,stats_keys,scores,game_stats_simple,player_stats_simple,avg_score,avg_time,game_stats=None,player_stats=None):
    self.scores = scores
    self.stats_keys = stats_keys
    self.game_stats = game_stats #lsit
    self.game_stats_simple = game_stats_simple
    self.player_stats = player_stats
    self.player_stats_simple = player_stats_simple
    self.avg_score = avg_score
    self.avg_time = avg_time

  def compute_avg_stat(self,stat):
    total_score = sum([game[self.stat(stat)] for game in self.game_stats_simple])
    return total_score/len(self.game_stats_simple)

  def convert_to_df(self):
    game_df = pd.DataFrame({stat:[s[self.stat(stat)] for s in self.game_stats_simple] for stat in self.stats_keys})
    return game_df

  def stat(self,key_string):
    return self.stats_keys.index(key_string)


class ExperimentAnalyser():
  def __init__(self, exp):
    self.experiments = exp

  def run(self):
    experiment = self.experiments[0]
    print(experiment)
    print(experiment.compute_avg_stat("score"))
    print(experiment.compute_avg_stat("regret"))
    print(experiment.convert_to_df())

